function ModalHeader({ setShown }) {
	return (
		<div className="modal-header">
			<h5 className="modal-title">Modal title</h5>
			<button
				type="button"
				className="btn-close"
				data-bs-dismiss="modal"
				aria-label="Close"
				onClick={() => {
					setShown(false);
				}}
			></button>
		</div>
	);
}
export default ModalHeader;
